import React, { useEffect } from 'react'
import Logo from '../../assets/images/logo.png'

function Header() {
    useEffect(() => {
        window.scroll(function () {
            var scroll = window.scrollTo();
            var box = document.getElementById('#top').height();
            var header = document.getElementsByClassName('header').height();

            console.log("scroll", scroll)

            if (scroll >= box - header) {
                document.getElementsByClassName("header-sticky").addClass("background-header");
            } else {
                document.getElementsByClassName("header-sticky").removeClass("background-header");
            }
        });
    }, []);
    return (
        <header className="header-area header-sticky">
            <div className="container">
                <div className="row">
                    <div className="col-12">
                        <nav className="main-nav">
                            <a href="#" className="logo">
                                <img src={Logo} />
                            </a>
                            <ul className="nav">
                                <li className="scroll-to-section"><a href="#top" className="active">Home</a></li>
                                <li className="scroll-to-section"><a href="#men">Men's</a></li>
                                <li className="scroll-to-section"><a href="#women">Women's</a></li>
                                <li className="scroll-to-section"><a href="#kids">Kid's</a></li>
                                <li className="submenu">
                                    <a href="#">Pages</a>
                                    <ul>
                                        <li><a href="about.html">About Us</a></li>
                                        <li><a href="products.html">Products</a></li>
                                        <li><a href="single-product.html">Single Product</a></li>
                                        <li><a href="contact.html">Contact Us</a></li>
                                    </ul>
                                </li>
                                <li className="submenu">
                                    <a href="#">Features</a>
                                    <ul>
                                        <li><a href="#">Features Page 1</a></li>
                                        <li><a href="#">Features Page 2</a></li>
                                        <li><a href="#">Features Page 3</a></li>
                                    </ul>
                                </li>
                                <li className="scroll-to-section"><a href="#explore">Explore</a></li>
                            </ul>
                            <a className='menu-trigger'>
                                <span>Menu</span>
                            </a>
                        </nav>
                    </div>
                </div>
            </div>
        </header>
    )
}

export default Header
